  ,\n\t\"ComplianceLeadStarRating\",\n\t\"ComplianceActive\",\n\t\"ComplianceDateMovedToStatus\"\
  ,\n\t\"ComplianceLead\",\n\t\"ComplianceSysID\",\n\t\"ComplianceDVLeadStatus\",\n\
  \t\"ComplianceDVAssignedTo\",\n\t\"ComplianceAssignedTo\"\n) as -- SEMANTIC LAYER\
  \ BEGINS\n\nSELECT \"NUMBER\" as \"ComplianceNumber\",\n       \"DV_U_LEAD_STAR_RATING\"\
  \ as \"ComplianceLeadStarRating\",\n       \"ACTIVE\" as \"ComplianceActive\",\n\
  \       \"U_DATE_MOVED_TO_STATUS\" as \"ComplianceDateMovedToStatus\",\n       \"\
  U_LEAD\" as \"ComplianceLead\",\n       \"SYS_ID\" as \"ComplianceSysID\",\n   \
  \    \"DV_U_LEAD_STATUS\" as \"ComplianceDVLeadStatus\",\n       \"DV_ASSIGNED_TO\"\
  \ as \"ComplianceDVAssignedTo\",\n       \"ASSIGNED_TO\" as \"ComplianceAssignedTo\"\
  \nFROM RDS.SURF.U_LEAD_COMPLIANCE;"
